ST.xhtml:
eRun(CLK:= (ifKp > 0 AND NOT ixManMode));

IF ixManMode THEN																//Skriver manuelt SP til utgang
	qfMv := ifManMv;
ELSIF eRun.Q THEN																//Hvis det er rising edge paastart betingelser vil diverse variabler resettes/initializes
	fIntegral := 0;
	fIntegMax:= fLastIntegMax := 1 / ifKp * (100 / (1 / ifTi));
	fLastTi:= ifTi;
	fLastKp:= ifKp;
	fLastAvvik:= fAvvik;
	tCycleTimer(IN:= FALSE);
	tCycleTimer(IN:= TRUE);
ELSIF ifKp > 0 THEN												//Hvis Kp er satt, kjoeres PID funksjon

	//Felles
		IF(ifInMax - ifInZero) = 0 THEN											//Sjekker om vi deler paa 0, og gir ut evt. feil
		qxError := TRUE;
		RETURN;
	ELSE																		//	Ellers omskaleres Inn-verdier fra valgt til 0-100, og feil resettes
		qxError := FALSE;
		fPv:= (100 / (ifInMax - ifInZero)) * (ifPv - ifInZero);
		fSp:= (100 / (ifInMax - ifInZero)) * (ifSP - ifInZero);
	END_IF

	//Teller syklys tid
	tCycleTimer();																//Kjoerer TON for aa sjekke hvor lang tid som har gaatt siden forgje utregning
	fCycleTime:= 0.001 * TIME_TO_REAL(tCycleTimer.ET);							//Omskalerer syklus tid fra TIME til REAL
	tCycleTimer(IN:= FALSE);													//Resetter TON
	tCycleTimer(IN:= TRUE);


	//Proporsjonalt avvik
	fAvvik:= fSp - fPv;															//Beregner avvik som brukes i P-leddet


	//Integralt avvik
	IF ifTi > 0 THEN															//Hvis I er mer en 0, kjoerer vi I-ledd beregning
		IF ifTi <> fLastTi OR ifKp <> fLastKp THEN								//Hvis Ti eller Kp endrer seg, omskaleres max verdi for integral og den eksisterende integral verdien. Lagrer div variabler til neste sjekk/skalering
			fIntegMax := 1 / ifKp * (100 / (1 / ifTi));
			fIntegral:= (fIntegMax / fLastIntegMax) * fIntegral;
			fLastIntegMax:= fIntegMax;
			fLastTi:= ifTi;
			fLastKp:= ifKp;
		END_IF

		fIntegral := LIMIT(0, (fIntegral + fAvvik * fCycleTime), fIntegMax);		//Beregner integral

		fI:= (1 / ifTi) * fIntegral;												//Beregner I-verdien

	ELSE
		fI := 0;																	//Skriver i til 0 hvis Ti er 0
	END_IF

	//Derivert avvik
	IF(fAvvik - fLastAvvik)<> 0  AND ifTd > 0 THEN							//Sjekker om D-ledd er i bruk, og hindrer at vi deler paa 0 ved feil
		fDerivat := (fAvvik - fLastAvvik) / fCycleTime;							//Deriverer avviket
		fD:= LIMIT(-100, (ifTd * fDerivat), 100);								//Beregner D-verdien
	ELSE
		fD := 0;
	END_IF


	//PID utregnign
	fPID:= LIMIT(0, (ifKp * (fAvvik + fI + fD) + ifBias), 100);				//Beregner PID utverdi i 0-100

	IF(ifOutMax - ifOutZero) = 0 THEN											//Sjekker om vi deler paa 0
		qxError := TRUE;
	ELSE																		//	Hvis ikke, omskaleres ut signal til valgt span og feil resettes
		qxError := FALSE;
		qfMv:= ((ifOutMax - ifOutZero) / 100) * fPID + ifOutZero;
	END_IF

ELSE																			//Skriver utgang til 0, hvis PID ikke er paa
	qfMv := 0;
END_IF
